import "./FoodItem.css";
import { getItemImgById } from "../util";
import { useNavigate } from "react-router-dom";

const FoodItem = ({ id, name, imageNum, scoville}) => {
    const navigate = useNavigate();

    const goDetail = () => {
        navigate(`/detail/${id}`);
    }

    return(
        <div className="FoodItem">
            <div className="image_section">
                <img onClick={goDetail} alt="img_food" src={getItemImgById(imageNum)}/>
            </div>
            <div className="text_section">
                <div className="text_itemName">{name}</div>
                <div className="text_schoville">스코빌지수: {scoville}</div>
            </div>
        </div>
    );
}

export default FoodItem;
